import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

const Tags = () => {
    return (
        <Router>
        <div className="tags-container">
            <a className="clover-light" href="minimal-sunlight">Minimal Sunlight</a>
            <a className="clover-light" href="moderate-sunlight">Moderate Sunlight</a>
            <a className="clover-light" href="intense-sunlight">Intense Sunlight</a>
            <a className="clover-light" href="less-water">Less Water</a>
            <a className="clover-light" href="more-water">More Water</a>
        </div>
        </Router>
    );
}

export default Tags;
